import './footer.css'
import logo from '../images/logo2.png'
import { Link } from "react-router-dom";

function Footer() {
    return (
      <div className="footer-div">      
        
         <footer >
          <div>
             <img src={logo} className='logo-aja'/>
             <h1>Lets Get In Touch!</h1>
             <p>Follow Us</p>
             <div>
             </div>
             <Link to="/contact-details">
                  <p>Contact Us</p>
             </Link>
          </div>
        </footer>
         
      </div>
    );
  }
  
  export default Footer;
